import { useState } from 'react';
import { Button } from './ui/button.tsx';
import { Input } from './ui/input.tsx';
import { Textarea } from './ui/textarea.tsx';
import { Badge } from './ui/badge.tsx';
import { Card, CardContent, CardHeader, CardTitle } from './ui/card.tsx';
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from './ui/select.tsx';
import { Music, Guitar, Mic, Piano, Drum, MapPin, Star, ArrowRight, ArrowLeft } from 'lucide-react';

interface OnboardingData {
  name: string;
  username: string;
  bio: string;
  avatar: string;
  instruments: string[];
  genres: string[];
  experience: 'Beginner' | 'Intermediate' | 'Advanced' | 'Professional';
  location: string;
}

interface MusicianOnboardingProps {
  onComplete: (data: OnboardingData) => void;
}

const INSTRUMENTS = [
  'Guitar', 'Bass', 'Drums', 'Piano', 'Keyboard', 'Violin', 'Cello', 'Saxophone',
  'Trumpet', 'Flute', 'Vocals', 'Ukulele', 'Mandolin', 'Banjo', 'Harmonica',
  'Clarinet', 'Trombone', 'Accordion', 'Harp', 'Percussion', 'Synthesizer', 'DJ'
];

const GENRES = [
  'Rock', 'Pop', 'Jazz', 'Blues', 'Country', 'Folk', 'Classical', 'Alternative',
  'Indie', 'Electronic', 'Hip Hop', 'R&B', 'Soul', 'Funk', 'Reggae', 'Punk',
  'Metal', 'Progressive', 'Fusion', 'World', 'Experimental', 'Ambient'
];

export function MusicianOnboarding({ onComplete }: MusicianOnboardingProps) {
  const [step, setStep] = useState(1);
  const [data, setData] = useState<OnboardingData>({
    name: '',
    username: '',
    bio: '',
    avatar: '',
    instruments: [],
    genres: [],
    experience: 'Beginner',
    location: ''
  });

  const handleInstrumentToggle = (instrument: string) => {
    setData(prev => ({
      ...prev,
      instruments: prev.instruments.includes(instrument)
        ? prev.instruments.filter(i => i !== instrument)
        : [...prev.instruments, instrument]
    }));
  };

  const handleGenreToggle = (genre: string) => {
    setData(prev => ({
      ...prev,
      genres: prev.genres.includes(genre)
        ? prev.genres.filter(g => g !== genre)
        : [...prev.genres, genre]
    }));
  };

  const handleNext = () => {
    if (step < 4) {
      setStep(step + 1);
    } else {
      onComplete(data);
    }
  };

  const handleBack = () => {
    if (step > 1) {
      setStep(step - 1);
    }
  };

  const isStepValid = () => {
    switch (step) {
      case 1:
        return data.name.trim() && data.username.trim();
      case 2:
        return data.instruments.length > 0;
      case 3:
        return data.genres.length > 0;
      case 4:
        return data.location.trim();
      default:
        return false;
    }
  };

  const totalSteps = 4;

  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-500 via-blue-500 to-blue-600 flex flex-col items-center justify-center px-4 py-12">
      {/* Music Icon */}
      <div className="w-20 h-20 bg-white rounded-full flex items-center justify-center mb-6 shadow-lg">
        <Music className="h-10 w-10 text-purple-500" />
      </div>

      {/* Title */}
      <h1 className="text-3xl font-bold text-white mb-2 text-center">Welcome to MusicConnect</h1>
      <p className="text-lg text-white/80 mb-8 text-center">Connect, collaborate, and create with musicians worldwide</p>

      {/* Stepper */}
      <div className="flex items-center space-x-2 mb-8">
        {Array.from({ length: totalSteps }, (_, i) => (
          <div key={i} className="flex items-center">
            <div className={`w-8 h-8 rounded-full flex items-center justify-center font-bold text-sm
              ${i + 1 === step ? 'bg-white text-purple-600' : 
                i + 1 < step ? 'bg-white/90 text-purple-500' : 'bg-purple-400/50 text-white'}`}>
              {i + 1}
            </div>
            {i < totalSteps - 1 && (
              <div className="w-8 h-[2px] bg-white/30 mx-1"></div>
            )}
          </div>
        ))}
      </div>

      {/* Content Card */}
      <Card className="w-full max-w-md bg-white rounded-xl shadow-xl">
        <CardContent className="p-6">
          {step === 1 && (
            <div className="space-y-4">
              <h2 className="text-xl font-medium text-center mb-4">Tell us about yourself</h2>
              <div>
                <label className="block text-sm font-medium mb-1">Full Name</label>
                <Input 
                  placeholder="Enter your full name" 
                  value={data.name} 
                  onChange={(e) => setData(prev => ({ ...prev, name: e.target.value }))} 
                  className="bg-gray-50"
                />
              </div>
              <div>
                <label className="block text-sm font-medium mb-1">Username</label>
                <Input 
                  placeholder="@yourusername" 
                  value={data.username} 
                  onChange={(e) => setData(prev => ({ ...prev, username: e.target.value }))} 
                  className="bg-gray-50"
                />
              </div>
              <div>
                <label className="block text-sm font-medium mb-1">Bio (Optional)</label>
                <Textarea 
                  placeholder="Tell other musicians about yourself..." 
                  value={data.bio} 
                  onChange={(e) => setData(prev => ({ ...prev, bio: e.target.value }))} 
                  className="bg-gray-50"
                />
              </div>
            </div>
          )}

          {/* Step 2: Instruments */}
          {step === 2 && (
            <div className="space-y-4">
              <p className="text-sm text-gray-600">Select all instruments you play:</p>
              <div className="grid grid-cols-2 gap-2 max-h-60 overflow-y-auto">
                {INSTRUMENTS.map((instrument) => (
                  <Badge
                    key={instrument}
                    variant={data.instruments.includes(instrument) ? "default" : "outline"}
                    className="cursor-pointer justify-center py-2"
                    onClick={() => handleInstrumentToggle(instrument)}
                  >
                    {instrument}
                  </Badge>
                ))}
              </div>
              {data.instruments.length > 0 && (
                <div className="mt-4">
                  <p className="text-sm font-medium mb-2">Selected:</p>
                  <div className="flex flex-wrap gap-1">
                    {data.instruments.map((instrument) => (
                      <Badge key={instrument} variant="secondary">
                        {instrument}
                      </Badge>
                    ))}
                  </div>
                </div>
              )}
            </div>
          )}

          {/* Step 3: Genres */}
          {step === 3 && (
            <div className="space-y-4">
              <p className="text-sm text-gray-600">What genres do you love?</p>
              <div className="grid grid-cols-2 gap-2 max-h-60 overflow-y-auto">
                {GENRES.map((genre) => (
                  <Badge
                    key={genre}
                    variant={data.genres.includes(genre) ? "default" : "outline"}
                    className="cursor-pointer justify-center py-2"
                    onClick={() => handleGenreToggle(genre)}
                  >
                    {genre}
                  </Badge>
                ))}
              </div>
              {data.genres.length > 0 && (
                <div className="mt-4">
                  <p className="text-sm font-medium mb-2">Selected:</p>
                  <div className="flex flex-wrap gap-1">
                    {data.genres.map((genre) => (
                      <Badge key={genre} variant="secondary">
                        {genre}
                      </Badge>
                    ))}
                  </div>
                </div>
              )}
            </div>
          )}

          {/* Step 4: Experience & Location */}
          {step === 4 && (
            <div className="space-y-4">
              <div>
                <label className="block text-sm font-medium mb-2">Experience Level</label>
                <Select value={data.experience} onValueChange={(value: any) => setData(prev => ({ ...prev, experience: value }))}>
                  <SelectTrigger>
                    <SelectValue />
                  </SelectTrigger>
                  <SelectContent>
                    <SelectItem value="Beginner">
                      <div className="flex items-center gap-2">
                        <Star className="w-4 h-4" />
                        Beginner - Just starting out
                      </div>
                    </SelectItem>
                    <SelectItem value="Intermediate">
                      <div className="flex items-center gap-2">
                        <Star className="w-4 h-4" />
                        Intermediate - Some experience
                      </div>
                    </SelectItem>
                    <SelectItem value="Advanced">
                      <div className="flex items-center gap-2">
                        <Star className="w-4 h-4" />
                        Advanced - Skilled player
                      </div>
                    </SelectItem>
                    <SelectItem value="Professional">
                      <div className="flex items-center gap-2">
                        <Star className="w-4 h-4" />
                        Professional - Music is my career
                      </div>
                    </SelectItem>
                  </SelectContent>
                </Select>
              </div>
              <div>
                <label className="block text-sm font-medium mb-2">Location</label>
                <div className="relative">
                  <MapPin className="absolute left-3 top-1/2 transform -translate-y-1/2 w-4 h-4 text-gray-400" />
                  <Input
                    value={data.location}
                    onChange={(e) => setData(prev => ({ ...prev, location: e.target.value }))}
                    placeholder="City, State/Country"
                    className="pl-10"
                  />
                </div>
              </div>
            </div>
          )}

          {/* Navigation Buttons */}
          <div className="flex justify-between mt-8">
            <Button 
              variant="outline" 
              onClick={() => step > 1 && setStep(s => s - 1)}
              disabled={step === 1}
              className="px-4 py-2"
            >
              <ArrowLeft className="mr-2 h-4 w-4" /> Back
            </Button>

            <Button 
              onClick={() => {
                if (step < totalSteps) {
                  setStep(s => s + 1);
                } else {
                  onComplete(data);
                }
              }}
              className="bg-gradient-to-r from-purple-500 to-blue-500 text-white px-4 py-2"
            >
              {step === totalSteps ? 'Complete' : 'Next'} <ArrowRight className="ml-2 h-4 w-4" />
            </Button>
          </div>
        </CardContent>
      </Card>
    </div>
  );
}
